import { RuleDTO } from '../utils/definitions.dto';
import styled from 'styled-components';

const RuleContainer = styled.div`
  padding: 8px 12px;
  line-height: 24px;
`;

export const Rule = ({ rule }: { rule: RuleDTO }) => {
  return (
    <a href="#">
      <RuleContainer>{rule.name}</RuleContainer>
    </a>
  );
};
